import { Component } from 'react'

import logo from '../../assets/logo.svg'

import './footer.css'

class Footer extends Component {
  render() {
    return (
      <footer>
        <img
          className="header__img"
          src={logo}
          alt="Logo du site de location d'appartements Kasa"
        />
      </footer>
    )
  }
}

export default Footer
